//import Fab from '@material-ui/core/Fab'
import React from 'react'
import '../style/index.css'

const Header = () => {
  const style = {
    display: 'flex',
    flexDirection: '',
  }
  return (
    <div>
      <div style={style}>
        <div>Logo</div>
        <div>
          <form action=''>
            <input type='text' name='' id='' />
            <button>Search</button>
          </form>
        </div>
      </div>
    </div>
  )
}

export default Header
